import{_ as t,o as a,c as s,h as i}from"./app.9d05627b.js";const A="/assets/comments.9b12314d.png",n="data:image/png;base64,",r="data:image/png;base64,",o="data:image/png;base64,",p="data:image/png;base64,",m="/assets/Setup.784955e5.png",l="/assets/loop.6291ebb7.png",h="/assets/LiquidCrytstalLibrary.42113990.png",c="/assets/AdafruitDHTSensorLibrary.39e7070c.png",d="/assets/DHTSensorLibraryExample.d28bf7a6.png",g="/assets/LiquidCrytstalExample.4a46d31d.png",b="/assets/sidebyside.323a62fb.png",f="/assets/sidebyside2.a5e425ae.png",u="/assets/sidebyside3.e084252d.png",v="/assets/sidebyside4.883300f5.png",O="/assets/sidebyside5.36e0a4ec.png",j="/assets/sidebyside6.be34443c.png",Z="/assets/sidebyside7.495aa7cd.png",k="/assets/sidebyside8.57441e45.png",w="/assets/sidebyside9.8f6248a5.png",y="data:image/png;base64,",e="data:image/png;base64,",x="/assets/sidebyside10.abd2b3a4.png",T="/assets/sidebyside11.2dfb99f3.png",U="data:image/png;base64,",R="/assets/sidebyside12.3939c77f.png",z="/assets/verifycompile.b1533f41.png",S="/assets/verifycompile2.c991d482.png",B="/assets/filecombodemo.851ca7ef.gif",K=JSON.parse('{"title":"Combining Sketches  | HOME |","description":"","frontmatter":{},"headers":[{"level":2,"title":"Block comments","slug":"block-comments","link":"#block-comments","children":[]},{"level":2,"title":"Libraries Include Section","slug":"libraries-include-section","link":"#libraries-include-section","children":[{"level":3,"title":"note","slug":"note","link":"#note","children":[]}]},{"level":2,"title":"Definition Section","slug":"definition-section","link":"#definition-section","children":[{"level":3,"title":"Note","slug":"note-1","link":"#note-1","children":[]}]},{"level":2,"title":"Global Variables","slug":"global-variables","link":"#global-variables","children":[]},{"level":2,"title":"Functions","slug":"functions","link":"#functions","children":[]},{"level":2,"title":"Setup","slug":"setup","link":"#setup","children":[]},{"level":2,"title":"Loop","slug":"loop","link":"#loop","children":[]}],"relativePath":"combiningSketches.md","lastUpdated":1675795441000}'),C={name:"combiningSketches.md"},W=i('<h1 id="combining-sketches-home" tabindex="-1">Combining Sketches | <a href="./README">HOME</a> | <a class="header-anchor" href="#combining-sketches-home" aria-hidden="true">#</a></h1><p>When combining two or more sketches, it is VERY important that you understand the various sections of the sketch, the next part of this guide is describing these sections.</p><p>You can skip over this, then come back later and read it when your combined sketches don’t work.</p><h1 id="arduino-basic-sketches-have-sections" tabindex="-1">Arduino basic sketches have sections <a class="header-anchor" href="#arduino-basic-sketches-have-sections" aria-hidden="true">#</a></h1><h2 id="block-comments" tabindex="-1">Block comments <a class="header-anchor" href="#block-comments" aria-hidden="true">#</a></h2><p>These can appear anywhere in the code but usually appear at the top with the author, description etc.</p><p><strong>Example</strong></p><p><img src="'+A+'" alt="image"></p><p>The block comments start with /*and end with*/</p><p>A single line comment starts with //</p><p>When combining sketches, you can ignore the comment lines and comment blocks if you want as Arduino code ignores these.</p><h2 id="libraries-include-section" tabindex="-1">Libraries Include Section <a class="header-anchor" href="#libraries-include-section" aria-hidden="true">#</a></h2><p>This section appears at the very top of the sketch.</p><h3 id="note" tabindex="-1">note <a class="header-anchor" href="#note" aria-hidden="true">#</a></h3><h5 id="there-are-some-very-special-cases-where-a-library-may-have-a-directive-required-before-the-library-is-loaded-this-is-very-unusual-but-can-happen-it-will-appear-as-a-define-xxxxxxx-before-the-include-library-statement" tabindex="-1"><em>(there are some VERY special cases where a library may have a directive required before the library is loaded. This is very unusual but can happen. It will appear as a #define XXXXXXX before the include library statement)</em> <a class="header-anchor" href="#there-are-some-very-special-cases-where-a-library-may-have-a-directive-required-before-the-library-is-loaded-this-is-very-unusual-but-can-happen-it-will-appear-as-a-define-xxxxxxx-before-the-include-library-statement" aria-hidden="true">#</a></h5><p>The library load/include command is in the form of:</p><p><code>#include &lt;library file name&gt;</code></p><p>This will load and include the library if it is in the standard library path. If you load a library using the library manager, then the library will be in the correct place to be loaded with this statement.</p><p>In special cases, the library include statement might be in the form of:</p><p><code>#include &quot;library file name&quot;</code></p><p>In this case the library file is not in the normal location.</p><p>If it is in the same directory as the sketch, then it will use this format.</p><p><em>It may also have the full path to the file as well, but this is a special case.</em></p><h2 id="definition-section" tabindex="-1">Definition Section <a class="header-anchor" href="#definition-section" aria-hidden="true">#</a></h2><p>Usually, a sketch will have constants here. These are variables that do not change.</p><p><strong>Example</strong></p><p><img src="'+n+'" alt="image"></p><h3 id="note-1" tabindex="-1">Note <a class="header-anchor" href="#note-1" aria-hidden="true">#</a></h3><h5 id="there-are-no-semi-colons-after-a-define" tabindex="-1"><em>there are no semi colons after a define.</em> <a class="header-anchor" href="#there-are-no-semi-colons-after-a-define" aria-hidden="true">#</a></h5><h2 id="global-variables" tabindex="-1">Global Variables <a class="header-anchor" href="#global-variables" aria-hidden="true">#</a></h2><p>A variable that changes and is used though out the sketch has a global scope. This means the variable can be accessed anywhere in the sketch.</p><p><strong>Example</strong></p><p><img src="'+r+'" alt="image"></p><h2 id="functions" tabindex="-1">Functions <a class="header-anchor" href="#functions" aria-hidden="true">#</a></h2><p>This is a section that may or not be in the sketch. Usual coding practice is to have any functions that are used in the sketch located here.</p><p>These functions may be simple or complex.</p><p><strong>Example</strong></p><p><img src="'+o+'" alt="image"></p><p>In the program, you would call this function with</p><p><img src="'+p+'" alt="image"></p><h2 id="setup" tabindex="-1">Setup <a class="header-anchor" href="#setup" aria-hidden="true">#</a></h2><p>This is a special section that runs once when the Arduino starts.</p><p>In this there are commands to start devices and or libraries.</p><p>Setup serial ports basically anything that needs to be done ONCE when the Arduino starts</p><p><strong>Example</strong></p><p><img src="'+m+'" alt="image"></p><h2 id="loop" tabindex="-1">Loop <a class="header-anchor" href="#loop" aria-hidden="true">#</a></h2><p>This is the section that runs all the time after setup.</p><p>Once setup has run, loop runs continuously. This is where your main code will be.</p><p><strong>Example</strong></p><p><img src="'+l+'" alt="image"></p><p>In this lesson on combining sketches, we will be using two sketches from the examples for two libraries.</p><p>One from LiquidCrytstal Library</p><p><img src="'+h+'" alt="image"></p><p>The other from Adafruit DHT Sensor Library</p><p><img src="'+c+'" alt="image"></p><p>This is the first file DHT_Unified_Sensor</p><p><img src="'+d+'" alt="image"></p><p>This is the second file Hello World</p><p><img src="'+g+'" alt="image"></p><p>These files are accessible via the file, examples menu as shown – <strong>AFTER you load the libraries using the library manager</strong></p><p>Here are the two files side by side. With the IDE you can open two files and set them up, side by side. Basically open the IDE twice.</p><p><img src="'+b+'" alt="image"></p><p>in each file there is a large comments block. To tidy up, we will remove them. This is optional.</p><p>This gives us the two files – in a form that is a little easier to work on</p><p><img src="'+f+'" alt="image"></p><p>First up, we copy the library load section</p><p><img src="'+u+'" alt="image"></p><p>This is the section copied from right file to left file</p><p><img src="'+v+'" alt="image"></p><p>The next section is the Definition Section</p><p>In these particular files, there are definitions in one file. We copy from the right side to the left side sketch. Checking that there are no definitions with the same names and or different values.</p><p><img src="'+O+'" alt="image"></p><p>This is the section copied from right file to left file</p><p><img src="'+j+'" alt="image"></p><p>Next is the Global Variables Section</p><p><img src="'+Z+'" alt="image"></p><p>Copy the variables and library initializer values Again checking that there are no variables with the same names and or different values.</p><p>This is the section copied from right file to left file</p><p><img src="'+k+'" alt="image"></p><p>Next section is the Setup</p><p><img src="'+w+'" alt="image"></p><p>NOTE: The contents of the Setup as copied but NOT the</p><p><img src="'+y+'" alt="image"></p><p>Or the</p><p><img src="'+e+'" alt="image"></p><p>at the end.</p><p>This is the section copied from right file to left file</p><p><img src="'+x+'" alt="image"></p><p>Next is the loop</p><p><img src="'+T+'" alt="image"></p><p>NOTE: The contents of the loop are copied but NOT the</p><p><img src="'+U+'" alt="image"></p><p>Or the</p><p><img src="'+e+'" alt="image"></p><p>at the end.</p><p><img src="'+R+'" alt="image"></p><p>The two sketches are combined.</p><p>If you now run verify, the sketch on the left should be able to verify</p><p><img src="'+z+'" alt="image"></p><p><img src="'+S+'" alt="image"></p><p>This combined sketch is complete except for changing the code to use both sketches features</p><p><img src="'+B+'" alt="image"></p><p>In this case, using the LCD to display the temperature and humidity readings</p>',104),F=[W];function H(N,P,Y,q,Q,E){return a(),s("div",null,F)}const J=t(C,[["render",H]]);export{K as __pageData,J as default};
